import React, { useEffect } from "react";

const Register = () => {
  const [data, setdata] = useState({
    email: "",
    password: "",
    fullname: "",
    dateOfBirth: "",
    gender: "",
    country: [],
    recieveNewsLetters: "",
  });
  const [countries, setcountries] = ueState([
    { id: 0, countryname: "India" },
    { id: 0, countryname: "French" },
    { id: 0, countryname: "Bhutan" },
    { id: 0, countryname: "Germany" },
  ]);
  useEffect(() => {
    document.title = "register";
  }, []);

  return (
    <div className="row">
      <div className="col-md-7 col-lg-6 mx-auto">
        <div className="card border-primary my-3">
          <div className="card-header border-bottom border-primary">
            <h3 className="text-center text-primary "> Register YourSelf</h3>
          </div>
          <div className="card-body border-bottom border-success">
            {/* Email start */}
            <div className="from-group form-row">
              <label htmlFor="email" className="col-lg-4">
                E-mail
              </label>
              <input
                type="text"
                name=""
                id="email"
                value={data.email}
                onChange={(e) => {
                  setstate({ ...data, [e.target.name]: e.target.value });
                }}
              />
              {/* Email end */}
              {/* Email start */}
              <div className="from-group form-row">
                <label htmlFor="email" className="col-lg-4">
                  E-mail
                </label>
                <input
                  type="text"
                  name=""
                  id="email"
                  value={data.email}
                  onChange={(e) => {
                    setstate({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
              {/* Email end */}

              {/* password start */}
              <div className="from-group form-row">
                <label htmlFor="password" className="col-lg-4">
                  E-mail
                </label>
                <input
                  type="text"
                  name=""
                  id="password"
                  value={data.password}
                  onChange={(e) => {
                    setstate({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
              {/* password end */}

              {/* fullname start */}
              <div className="from-group form-row">
                <label htmlFor="fullname" className="col-lg-4">
                  E-mail
                </label>
                <input
                  type="text"
                  name=""
                  id="fullname"
                  value={data.fullname}
                  onChange={(e) => {
                    setstate({ ...data, [e.target.name]: e.target.value });
                  }}
                />
              </div>
              {/* fullname end */}
               {/* dob start */}
                  
                {/* dob end */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Register;
